schema:
{
  "collections": [{
    "name": "traffic_events",
    "document": {
      "properties": {
        "identifier": {
          "bsonType": "object",
          "properties": {
            "intersection_id": {"description": "Filter by traffic junction"},
            "camera_id": {"description": "Filter by surveillance unit"}
          }
        },
        "response": {
          "bsonType": "object",
          "properties": {
            "event": {
              "properties": {
                "severity": {"description": "Critical, High, Low"},
                "type": {"description": "Speeding, RedLightViolation, IllegalParking"},
                "vehicles": {
                  "bsonType": "array",
                  "items": {
                    "properties": {
                      "number_plate": {
                        "bsonType": "string",
                        "pattern": "^[A-Z]{2}[0-9]{2}[A-Z]{2}[0-9]{4}$"
                      },
                      "speed": {"bsonType": "double"},
                      "timestamp": {"bsonType": "date"},
                      "location": {
                        "bsonType": "array",
                        "items": {"bsonType": "double"}
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  }],
  "version": 2
}

